import React, {useState} from 'react';
import Mate from "./List.js";
import Form from "./Form.js";
import './App.css';

function App() {
  const Teammates = [];


  return (
    <div>
      <Form Teammates={Teammates} />
      <Mate prop={Teammates} />
    </div>
  );
}

export default App;
